import React from "react";

const TableHead = ({ columns, sortColumn, setSortColumn }) => {
  function handleSort() {
    const order = sortColumn.order === "asc" ? "desc" : "asc";
  }

  return (
    <thead>
      <tr>
        {columns.map((column, ind) => {
          return <th key={ind}>{column.label}</th>;
        })}
      </tr>
    </thead>
  );
};

export default TableHead;
